var tipuesearch = {"pages":[{"title":"About","text":"40723221管理網誌 期中報告影片: https://www.youtube.com/watch?v=urQoNi4i0Xk 個人儲倉: https://s40723221.github.io/cad2019/content/index.html 個人投影片: https://s40723221.github.io/cad2019/reveal/index.html#/ 課程網誌: https://s40723221.github.io/cad2019/blog/index.html 內容管理網誌 課程倉儲: https://github.com/chiamingyen/cmsimfly 內容管理: https://chiamingyen.github.io/cmsimfly/ 課程投影片: https://chiamingyen.github.io/cmsimfly/reveal 課程網誌: https://chiamingyen.github.io/cmsimfly/blog","tags":"misc","url":"./pages/about/"},{"title":"電腦輔助設計實習期中報告內容","text":"期中報告影片: 期中報告reveal: https://s40723221.github.io/cad2019/reveal/index.html#/ 40723221倉儲: https://s40723221.github.io/cad2019/content/index.html 期中報告心得: 從第二週開始一年級所學的github到了第三週第五週後第七週的solvespace讓我學到了如何編議自己的solvespace製圖軟體也熟悉如何去操作這個小至只有幾MB的製圖軟體，再把這樣的技術發揮繪製出零件之後丟入進行模擬，一開始從來想不到可以利用只有幾GB的隨身系統辦到這麼多的事情，非常的不容易也讓我體認到擁有網路的技術和世界比我想得更廣更方便，掌握了這些資源之後希望可以在以後進入職場或者是在研究所更佳的深入理解或者是實際用上。 每週內容: week2內容:建立個人倉儲並下載新的個人可攜套件 week3內容:編譯solvespace week4內容:影片新增浮水印並補上以前的進度 week5內容:練習solvespace並熟悉solvespace的操作方式 week6內容: 任務1:參數化零組件繪製二輪自走車 任務2:網際 V-rep 模型控制 任務3:新增啟動與停止按鈕 week7內容: 任務1:solvespace編譯-更改HELP中ABOUT的VERSION 任務2:solvespace繪圖驗證 week8內容: 建立webot開啟檔案 開啟網誌 讓ssh對github連線","tags":"Misc","url":"./40723221Interim report.html"}]};